import React from "react";
import logogov from "../../assets/images/header_govco.png"
import logo from "../../assets/images/logocrc.jpg"

const Header = () => {
    return (
        <header className="header">
            <div className="header-puntogov">
            <img className="header-logogov" src={logogov} alt="logo-gov" />
            </div>            
            <img className="header-logocrc" src={logo} alt="logo-CRC" />
        </header>
    )
}

export default Header
